import React from 'react';
import Navbar from 'react-bootstrap/Navbar'

export default class Nav extends React.Component {
    render() {
        return (
            <div className='navigation'>
                <p> NAVBAR </p>
                <ul className='row'>
                    <li className='item-nav'>
                        <a href='/'> home </a>
                    </li>
                    <li className='item-nav'>
                        <a href='/article'> article </a>
                    </li>
                </ul>
            </div>
        );
    }
}
